import React, { Component } from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.css';

class Top extends Component{
    render(){
        return(
            <div>
                <div class="row padding-content">
                    <div class="col-3"></div>
                    <div class="col-6 "><h2>My portfolio</h2></div>
                    <div class="col-3"></div>
                </div>
            </div>
        );
    }
}

export default Top;
